import { useStyles } from './styles'
import CenteredImage from '../_Modules/centeredImage';
import { supremeTitleLogoURL } from '../../../data/constants';
import { Header } from 'tabler-react';

import {
  Grid,
  Typography,
  Box
} from '@material-ui/core';

let today = new Date()


export default function ReportCardHeader(props) {
  const { data } = props
  const classes = useStyles();

  let accountHeader = data ? data['Account'] : ''
  let renewal = data ? data['Renewal'] : ''
  return (
      <Grid continaer spacing={2}>
        <Grid item xs={6}>
          <div className={classes.div}>
            <Box marginLeft={4}>
              <Typography className={classes.accountHeader} >{accountHeader}</Typography>
              <Typography className={classes.date}>Contract Expiration & Goal Renewal:<strong> {renewal}</strong></Typography>
            </Box>
          </div>
        </Grid>
        <Grid item xs>
            <Typography className={classes.date}>Reporting Data: </Typography>
        </Grid>
      </Grid>


  );
}
